sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var input=inputs.incoming;
var builderRes;
if(!inputs.builderRes.productId){
    builderRes=JSON.parse(inputs.builderRes);
}
else{
    builderRes=inputs.builderRes;
}

if(input.funds && input.funds.length>0){
    builderRes.funds=input.funds;
}

if(input.rider && input.rider.length>0){
    builderRes.rider=input.rider;
}

outputs.req=builderRes

})(inputs, outputs);

